import styled from "styled-components";

export const Ul = styled.ul`
ul {
  list-style: none;
  padding: 30px;
  list-style-position: inside;
  text-align: center;
}

ul li {
  margin-bottom: 15px;
  margin-right: 50px;
  text-align: center;
  list-style: none;
  font-size: .9em;
}

.subtitle{
    color: rgb(8, 165, 238);
}

.name{
    font-size: 1em;
}

`;
